  Code = "class Solution:\n    def isPalindrome(self, x: int) -> bool:\n        if x < 0:\n            return False\n        \n        if x < 10:\n            return True\n        \n        number = []\n\n        while x:\n            remainder = x % 10\n            x = x // 10\n            number.append(remainder)\n            \n        length = len(number)\n        half_index = length // 2\n\n        for i, digit in enumerate(number):\n            last_digit = number[length - i - 1]\n\n            if digit != last_digit:\n                return False\n            \n            if i != half_index:\n                continue\n            \n            return True\n"
